import React from 'react';
import classNames from 'classnames';


const Logo = ({
  className,
  ...props
}) => {

  const classes = classNames(
    'brand',
    className
  );

  return (
    <div
      {...props}
      className={classes}
    >
    </div>
  );
}

export default Logo;
